import React, { Component } from "react";

class File extends Component{
    render (){
        const names=["ayman","ahmed"]
        names.map(function(e){
            console.log(` <h1>hi ${e}</h1>`)
        })
        return(
            <h1>hi</h1>
        )
    }
}

export default File
